summary: "An inference made by the Radiology Insights model regarding a patient.\n\
  \n* AgeMismatch \n\n* SexMismatch \n\n* LateralityDiscrepancy \n\n* CompleteOrderDiscrepancy\
  \ \n\n* LimitedOrderDiscrepancy \n\n* Finding \n\n* CriticalResult \n\n* FollowupRecommendation\
  \ \n\n* RadiologyProcedure \n\n* FollowupCommunication. \n\nYou probably want to\
  \ use the sub-classes and not this class directly. Known sub-classes are:\nAgeMismatchInference,\
  \ CompleteOrderDiscrepancyInference, CriticalResultInference,\nFindingInference,\
  \ FollowupCommunicationInference, FollowupRecommendationInference,\nLateralityDiscrepancyInference,\
  \ LimitedOrderDiscrepancyInference, RadiologyProcedureInference,\nSexMismatchInference\n\
  \nAll required parameters must be populated in order to send to server."
